    <ul className="list-ul">
      <li>
        <PDFFIle href="" title="Spanish Adjectives" />
      </li>
      <li>
        <PDFFIle title="Spanish Prepositions" />
      </li>
      <li>
        <PDFFIle title="Easy Exercise 3" />
      </li>
      <li>
        <PDFFIle title="Easy Exercise 4" />
      </li>
    </ul>

    <style>
      {`
      .list-ul {
        padding-left: 20px;
        margin-top: -10px;
      }

      .list-ul li {
        padding-bottom: 10px;
      }
      `}
    </style>
  </div>
);

export default UsefulPhrases;
